import React from 'react';
import styled from "styled-components";
import Logo from "../common/Logo";

const StyledHeader = styled.header`
  display: flex;
  height: 10vh;
  width: 100%;
  font-size: 1.5rem;
`

function Header() {
  return (
    <>
      <StyledHeader>
        <Logo/>
      </StyledHeader>
    </>
  );
}

export default Header;
